# Define a function to calculate the number of factors
def num_factors(n):
    i = 2
    factors = 0
    while i * i <= n:
        if n % i:
            i += 1
        elif i * i == n:
            factors += 1
            i += 1
        else:
            factors += 2
            i += 1
    return factors

